        paddingBottom: token.itemPaddingBottom,
        fontSize: token.fontSize,
        listStyle: 'none',
        '&-tail': {
          position: 'absolute',
          insetBlockStart: token.itemHeadSize,
          insetInlineStart: (token.itemHeadSize - token.tailWidth) / 2,
          height: `calc(100% - ${token.itemHeadSize}px)`,
